import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import HomePageMenu from "./components/HomeComponents/HomePageMenu";
import AboutMe from "./components/MyProfileComponents/AboutMe";
import { Grid, Typography, Paper, darken } from "@material-ui/core";
import { ThemeProvider, createMuiTheme } from "@material-ui/core/styles";
import React from "react";
import SideBar from "./components/HomeComponents/SideBar";

import "./components/ApartmentComponents/CardStyle.css";
function App() {
  const darkTheme = createMuiTheme({
    palette: {
      type: "dark",
      background: {
        default: "#000000",
        paper: "#000000",
      },
      text: {
        primary: "#fff",
      },
    },
  });
  const whiteTheme = createMuiTheme({
    palette: {
      type: "light",
    },
  });

  return (
    <BrowserRouter>
      <ThemeProvider theme={darkTheme}>
        <Paper style={{ height: "100vh" }}>
          <SideBar />
          <Route path="/aboutMe" component={AboutMe} />
          <Route path="/" component={HomePageMenu} />
        </Paper>
      </ThemeProvider>
    </BrowserRouter>
  );
}

export default App;
